      "text": "3. Ein Losament mit einem schönen Laden und\nLaden Stüblein nebst einem grossen Sommer\nhaus, Stubeu, Kuchin, 2 grosse Kammern,\neinem besondern Keller, Holzhaus, ein beschlos\nsenes Bauchhaus, auf der Eisengaß, im Be\nrichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "text": "1. Es sucht jemand einen silbern Schreibzeng\nmit aller Zugehördt und schoner Fafon, der\nLiebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "4. Ein Losament in der Fröschgaß von einer Stus\nben, 2 Kammern und Blaß zum Holz, auf\nPfingst-Fronfasten zu beziehen, im Berichthaus\nzu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "2. Man begehrt eine Chaise mit 4 Rådern zu et\nwann 3 Pläßen und zu einem Pferd samt ges\nhörigem Geschirr, der Liebhaber ist im Bes\nrichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "s. Ein Lofament für 2 Personen in der Weissens\nGak, bestehend aus einem Stublein und Ale\nkofen, Plas zum Hausrath zu stellen, auf eis\nnem Boden, wie auch Plaß zum Holz, Bruns\nnen un Haus, à rs Pfund Zins des Fahrs,\nkan gleich bezogen werden, im Berichthaus zu\nerfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "3. Wer hier oder auf dem Land noch neuen Tra\nber Brandtewein Ohmenweis zu verkaufen\nhat, kan im Berichthaus einen Kaufer darzu\ndernehmen, wie auch zu einem mittelmäßigen\nSponton, so ebenfahis begehrt wird, beydes\nshne Entgeldt im Berichthaus ist zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "6. Ein schönes Losament ebenes Fusses auf eis\nnem Boden von 3 Stuben, einem groffen\nSaal, Kammern, Kuchin, Keller, Plak zum\nHolz, Zutritt zum Bauchhaus, und, fo belies\nbig, einem Garten in der Aeschemer Vorstadt,\nim Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "4. Es fucht jemand eine gute, solide und unges\nfehr einen Saum haltende Feuersprißen zum\ntragen oder zum führen, der Liebhaber ist im\nBerichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "7. Eine grosse doppelte Frucht Schutte auf\nE. E. Gesekschaft zum Hohen Rupf."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "4. Es sucht zerwand enten mögingenen Krons\nLeuchter mit & Lichtstöcken, der Liebhaber ist\nim Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "8. Bis den 1gten diß wird eine sargende Hündin\nbegehrt, um etliche junge Hunde zu auferzies\nhen, gegen einer Erkanntlichkeit; wo sich anzu\nmelden, ist im Berichthaus ohne Entgeldt zu\nvernehmen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "6. Es verlangt jemand eine nicht gar grosse eis\nferne Geldt Casta zu kaufen, der Liebhaber ist\nim Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "9. Auf kunftige Weyhnacht ist unter der St. Pe\nters Schul ein geraumiges Magazin zu verlei\nhen, darum sich in dem Schulhaus anzu\nmelden."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "7. Es verlangt iemand einen glatten nußbaumern\nzweythurigen Kasten, der Liebhaber ist im Bes\nrichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "8. Man verlangt einen noch guten Kachel-Ofen\nmittelmäßiger Grosse mit oder ohne Fuß, der\nLiebhaber ist in Berichthaus zu erfragen; lei\ndet aber keinen Verzug."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "1. Ein Losameut mitten im Offenburger Hof,\nwie der Augenschein zeigen wird, auf nächste\nFasnacht oder Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": null,
      "tags_section": "Kost, Information und Bedienun\ngen werden angetragen und begehrt:",
      "text": "1. In ein wackerès protestantisches Haus in denew\nNiederlanden wird ein Candidatus Theologiæ,\nder neben andern auch die französische Sprach\nverstände, zu einem Haus Praceptor begehrt,\nweshalb sich im Berichthaus zu melden."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "2. Ein sauberes Losament an der Spalen von eis\nner Stuben und Nebenkammer, oder nach\nBelieben wo Kammern samt einem heitern\nSommerbaus, alles auf einem Boden, und\nnach Belieben Stallung und Heubuhne, auf\nPfingst Fronfasten zu beziehen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "2. Man verlangt einen Menschen in eine Fabris\nle, der sich zu allerley Haus Geschäften brau\nchen liesse, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "3. Man sucht einen Stauknecht in ein Wirths\nHaus, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "4. Ein"
    }
  ]
}

